  // export default About;
  import React from "react";
  import CommonSection from "../components/UI/CommonSection";
  import Helmet from "../components/Helmet/Helmet";
  import AboutSection from "../components/UI/AboutSection";
  import { Container, Row, Col } from "reactstrap";
  
  import hospitalImg from "../assets/all-images/ava-3.jpg"; // Replace with your hospital image
  import OurStaff from "../components/UI/OurStaff"; // Assuming this component displays staff info
  
  import "../styles/about.css";
  
  const About = () => {
    return (
      <Helmet title="About">
        <CommonSection title="About Us" />
        <AboutSection aboutClass="aboutPage" />
  
        <section className="about__page-section">
          <Container>
            <Row>
              <Col lg="6" md="6" sm="12">
                <div className="about__page-img">
                  <img src={hospitalImg} alt="Hospital Building" className="w-100 rounded-3" />
                </div>
              </Col>
  
              <Col lg="6" md="6" sm="12">
                <div className="about__page-content">
                  <h2 className="section__title">
                    Providing Compassionate and Quality Healthcare Solutions
                  </h2>
  
                  <p className="section__description">
                    [Your hospital's mission statement, highlighting values and goals.]
                  </p>
  
                  <p className="section__description">
                    We are a team of dedicated professionals committed to delivering
                    exceptional care to our patients. We utilize state-of-the-art
                    technology and evidence-based practices to ensure optimal
                    outcomes.
                  </p>
  
                  <div className="d-flex align-items-center gap-3 mt-4">
                    <span className="fs-4">
                      <i class="ri-phone-line"></i>
                    </span>
  
                    <div>
                      <h6 className="section__subtitle">Need an Appointment?</h6>
                      <h4>[Hospital phone number]</h4>
                    </div>
                  </div>
                </div>
              </Col>
            </Row>
          </Container>
        </section>
  
        <section>
          <Container>
            <Row>
              <Col lg="12" className="mb-5 text-center">
                <h6 className="section__subtitle">Your Trusted Team</h6>
                <h2 className="section__title">Meet Our Healthcare Professionals</h2>
              </Col>
              <OurStaff /> // Assuming this component displays staff info
            </Row>
          </Container>
        </section>
      </Helmet>
    );
  };
  
  export default About;
